// EASY https://www.hackerrank.com/challenges/game-of-thrones/problem

#include <gtest/gtest.h>

#include <algorithm>
#include <map>
#include <string>

namespace {
	std::string gameOfThrones(std::string const& s) {

		std::map<char, int> freq;
		std::for_each(s.begin(), s.end(), [&freq](char c) { ++freq[c]; });

		bool canHaveOdd = s.size() % 2 == 1;

		for (auto const& f : freq)
		{
			if (f.second % 2 == 1)
			{
				if (!canHaveOdd)
					return "NO";
				canHaveOdd = false;
			}
		}
		return "YES";
	}
}

TEST(GameOfThrones, example)
{
	EXPECT_EQ("YES", gameOfThrones("aabbccdd"));
}

TEST(GameOfThrones, sample0)
{
	EXPECT_EQ("YES", gameOfThrones("aabbccdd"));
}

TEST(GameOfThrones, sample1)
{
	EXPECT_EQ("NO", gameOfThrones("cdefghmnopqrstuvw"));
}

TEST(GameOfThrones, sample2)
{
	EXPECT_EQ("YES", gameOfThrones("cdcdcdcdeeeef"));
}

TEST(GameOfThrones, case0)
{
	EXPECT_EQ("YES", gameOfThrones("aabbccdd"));
}

TEST(GameOfThrones, case1)
{
	EXPECT_EQ("NO", gameOfThrones("cdefghmnopqrstuvw"));
}

TEST(GameOfThrones, case2)
{
	EXPECT_EQ("YES", gameOfThrones("cdcdcdcdeeeef"));
}

